import React from "react";
import {Link} from "react-router-dom"

function Projects() {
    return(
        <>
        <h2> This is the Projects page</h2>
        
        <nav>
            <Link to ="/"> Home </Link>
        </nav>

        <nav>
        <Link to ="about"> About </Link>
        </nav>

        <nav>
          <Link to ="contact"> Contact Me </Link>
        </nav>
        </>

    );
}

export default Projects
